import React from 'react'
import firstPic from '../../assets/service-2.jpg';
import secondPic from '../../assets/about-5.jpg';

const Portfolio = () => {
  return (
    <div>
      <div>
      <img src={firstPic} alt="firstPic" />
      <img src={secondPic} alt="secondPic" />
      </div>
    </div>
  )
}

export default Portfolio
